<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Intelligence Cycle - دورة الاستخبارات</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Courier New', monospace;
            background: linear-gradient(135deg, #1a5f5f 0%, #0d3838 100%);
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            padding: 20px;
            color: #fff;
        }

        .container {
            max-width: 1200px;
            width: 100%;
        }

        .header {
            text-align: center;
            margin-bottom: 40px;
            image-rendering: pixelated;
        }

        .header h1 {
            font-size: 2.5em;
            text-shadow: 4px 4px 0px #000;
            margin-bottom: 10px;
            letter-spacing: 2px;
        }

        .header .arabic {
            font-size: 2em;
            margin-top: 10px;
        }

        .cycle-container {
            position: relative;
            width: 600px;
            height: 600px;
            margin: 0 auto 40px;
            background: #0a2828;
            border: 8px solid #2d7a7a;
            box-shadow: 0 0 40px rgba(0, 255, 255, 0.3);
            image-rendering: pixelated;
        }

        .center-circle {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 180px;
            height: 180px;
            background: #1a4d4d;
            border: 6px solid #3d9999;
            border-radius: 50%;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            text-align: center;
            padding: 20px;
            box-shadow: 0 0 30px rgba(61, 153, 153, 0.5);
            z-index: 10;
        }

        .center-text {
            font-size: 0.9em;
            line-height: 1.4;
            pointer-events: none;
        }

        .cycle-stage {
            position: absolute;
            width: 140px;
            height: 140px;
            background: #2d5a5a;
            border: 6px solid #4db8b8;
            cursor: pointer;
            transition: all 0.3s ease;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            text-align: center;
            padding: 15px;
            image-rendering: pixelated;
            box-shadow: 0 0 20px rgba(77, 184, 184, 0.3);
            z-index: 10;
        }

        .cycle-stage:hover {
            background: #3d7a7a;
            border-color: #5dcdcd;
            box-shadow: 0 0 40px rgba(93, 205, 205, 0.6);
            z-index: 20;
        }

        .cycle-stage.active {
            background: #4d9a9a;
            border-color: #6de0e0;
            box-shadow: 0 0 50px rgba(109, 224, 224, 0.8);
        }

        .stage-title {
            font-size: 1.1em;
            font-weight: bold;
            margin-bottom: 8px;
            text-shadow: 2px 2px 0px #000;
        }

        .stage-arabic {
            font-size: 0.95em;
            color: #a0e0e0;
        }

        /* Position stages in a circle */
        .stage-1 { top: 40px; left: 50%; transform: translateX(-50%); }
        .stage-2 { top: 50%; right: 40px; transform: translateY(-50%); }
        .stage-3 { bottom: 40px; left: 50%; transform: translateX(-50%); }
        .stage-4 { top: 50%; left: 40px; transform: translateY(-50%); }

        /* Arrows */
        .arrow {
            position: absolute;
            width: 70px;
            height: 70px;
            pointer-events: none;
            z-index: 8;
        }

        .arrow::before {
            content: '';
            position: absolute;
            left: 0;
            top: 50%;
            transform: translateY(-50%);
            width: 55px;
            height: 3px;
            background: linear-gradient(90deg, #4db8b8 0%, #6de0e0 100%);
            box-shadow: 0 0 12px rgba(77, 184, 184, 0.5);
            border-radius: 2px;
            animation: arrow-flow 2.5s ease-in-out infinite;
        }

        @keyframes arrow-flow {
            0%, 100% {
                opacity: 0.7;
                box-shadow: 0 0 12px rgba(77, 184, 184, 0.5);
            }
            50% {
                opacity: 1;
                box-shadow: 0 0 20px rgba(109, 224, 224, 0.8);
            }
        }

        .arrow::after {
            content: '';
            position: absolute;
            right: 0;
            top: 50%;
            transform: translateY(-50%);
            width: 0;
            height: 0;
            border-style: solid;
            border-width: 7px 0 7px 12px;
            border-color: transparent transparent transparent #6de0e0;
            filter: drop-shadow(0 0 6px rgba(109, 224, 224, 0.6));
        }

        .arrow-1 {
            top: 150px;
            right: 115px;
            transform: rotate(45deg);
        }

        .arrow-2 {
            bottom: 150px;
            right: 115px;
            transform: rotate(135deg);
        }

        .arrow-3 {
            bottom: 150px;
            left: 115px;
            transform: rotate(225deg);
        }

        .arrow-4 {
            top: 150px;
            left: 115px;
            transform: rotate(315deg);
        }

        /* Soldier illustrations */
        .soldier {
            position: absolute;
            width: 180px;
            height: 180px;
            z-index: 5;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .soldier img {
            width: 100%;
            height: 100%;
            object-fit: contain;
            image-rendering: crisp-edges;
        }

        /* Soldier animations */
        @keyframes soldier-salute {
            0%, 100% { transform: translate(-50%, 0) translateY(0); }
            50% { transform: translate(-50%, 0) translateY(-8px); }
        }

        @keyframes soldier-scan {
            0%, 100% { transform: translate(0, -50%) rotate(-8deg); }
            50% { transform: translate(0, -50%) rotate(8deg); }
        }

        @keyframes soldier-think {
            0%, 100% { transform: translate(-50%, 0) scale(1); }
            50% { transform: translate(-50%, 0) scale(1.08); }
        }

        @keyframes soldier-communicate {
            0%, 25% { transform: translate(0, -50%) scale(1); }
            50% { transform: translate(0, -50%) scale(1.05); }
            75%, 100% { transform: translate(0, -50%) scale(1); }
        }

        .soldier-1 {
            top: -80px;
            left: 50%;
            transform: translateX(-50%);
            animation: soldier-salute 2.5s ease-in-out infinite;
        }

        .soldier-2 {
            top: 50%;
            right: -90px;
            transform: translateY(-50%);
            animation: soldier-scan 3.5s ease-in-out infinite;
        }

        .soldier-3 {
            bottom: -80px;
            left: 50%;
            transform: translateX(-50%);
            animation: soldier-think 3s ease-in-out infinite;
        }

        .soldier-4 {
            top: 50%;
            left: -90px;
            transform: translateY(-50%);
            animation: soldier-communicate 2.5s ease-in-out infinite;
        }

        /* Popup modal */
        .modal {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.8);
            z-index: 1000;
            justify-content: center;
            align-items: center;
            padding: 20px;
        }

        .modal.show {
            display: flex;
        }

        .modal-content {
            background: #0a2828;
            border: 8px solid #4db8b8;
            max-width: 700px;
            width: 100%;
            max-height: 80vh;
            overflow-y: auto;
            padding: 30px;
            position: relative;
            box-shadow: 0 0 50px rgba(77, 184, 184, 0.5);
        }

        .modal-close {
            position: absolute;
            top: 10px;
            right: 10px;
            background: #d44;
            border: 4px solid #f66;
            color: #fff;
            width: 40px;
            height: 40px;
            font-size: 24px;
            cursor: pointer;
            display: flex;
            justify-content: center;
            align-items: center;
            transition: all 0.3s ease;
        }

        .modal-close:hover {
            background: #f55;
            transform: scale(1.1);
        }

        .modal h2 {
            font-size: 2.2em;
            margin-bottom: 10px;
            text-shadow: 3px 3px 0px #000;
            color: #6de0e0;
            text-transform: uppercase;
            letter-spacing: 2px;
        }

        .modal .arabic-title {
            font-size: 1.6em;
            margin-bottom: 25px;
            color: #a0e0e0;
            padding-bottom: 15px;
            border-bottom: 3px solid #2d7a7a;
        }

        .modal .stage-description {
            background: #1a4d4d;
            padding: 20px;
            margin-bottom: 25px;
            border-left: 6px solid #4db8b8;
            font-size: 1.15em;
            line-height: 1.7;
            color: #e0f0f0;
        }

        .key-points {
            margin-top: 20px;
        }

        .key-points h3 {
            color: #6de0e0;
            margin-bottom: 20px;
            font-size: 1.5em;
            text-shadow: 2px 2px 0px #000;
            text-transform: uppercase;
            letter-spacing: 1px;
        }

        .key-points ul {
            list-style: none;
            padding: 0;
        }

        .key-points li {
            padding: 15px;
            margin: 15px 0;
            background: #0d3838;
            border-left: 6px solid #4db8b8;
            font-size: 1.05em;
            line-height: 1.8;
            transition: all 0.3s ease;
        }

        .key-points li:hover {
            background: #1a4d4d;
            border-left-color: #5dcdcd;
            transform: translateX(5px);
        }

        .key-points .acronym {
            color: #6de0e0;
            font-weight: bold;
            font-size: 1.1em;
        }

        .key-points .explanation {
            color: #a0e0e0;
            font-size: 0.95em;
            display: block;
            margin-top: 5px;
            padding-left: 10px;
            border-left: 2px solid #2d7a7a;
            margin-left: 5px;
        }

        .soldier-animation {
            width: 180px;
            height: 180px;
            margin: 20px auto;
            position: relative;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .soldier-animation img {
            max-width: 100%;
            max-height: 100%;
            object-fit: contain;
        }

        @media (max-width: 768px) {
            body {
                padding: 10px;
            }

            .header h1 {
                font-size: 1.8em;
            }

            .header .arabic {
                font-size: 1.2em;
            }

            .cycle-container {
                width: 90vw;
                height: 90vw;
                max-width: 400px;
                max-height: 400px;
            }

            .cycle-stage {
                width: 90px;
                height: 90px;
                padding: 8px;
                border-width: 4px;
            }

            .stage-title {
                font-size: 0.7em;
            }

            .stage-arabic {
                font-size: 0.65em;
            }

            .center-circle {
                width: 120px;
                height: 120px;
                padding: 15px;
            }

            .center-text {
                font-size: 0.7em;
            }

            .soldier {
                width: 120px;
                height: 120px;
            }

            .soldier-1 {
                top: -50px;
            }

            .soldier-2 {
                right: -60px;
            }

            .soldier-3 {
                bottom: -50px;
            }

            .soldier-4 {
                left: -60px;
            }

            .arrow {
                width: 50px;
                height: 50px;
            }

            .arrow::before {
                width: 35px;
                height: 2px;
            }

            .arrow::after {
                border-width: 5px 0 5px 8px;
            }

            .modal-content {
                width: 95%;
                max-width: 100%;
                max-height: 90vh;
                padding: 20px;
                overflow-y: auto;
            }

            .modal h2 {
                font-size: 1.5em;
            }

            .modal .arabic-title {
                font-size: 1.2em;
            }

            .modal .stage-description {
                font-size: 1em;
                padding: 15px;
            }

            .key-points h3 {
                font-size: 1.2em;
            }

            .key-points li {
                padding: 12px;
                font-size: 0.95em;
            }

            .soldier-animation {
                width: 140px;
                height: 140px;
            }
        }

        @media (max-width: 480px) {
            .cycle-container {
                width: 95vw;
                height: 95vw;
                max-width: 320px;
                max-height: 320px;
            }

            .cycle-stage {
                width: 70px;
                height: 70px;
                padding: 5px;
            }

            .stage-title {
                font-size: 0.6em;
            }

            .stage-arabic {
                font-size: 0.55em;
            }

            .center-circle {
                width: 90px;
                height: 90px;
                padding: 10px;
            }

            .center-text {
                font-size: 0.6em;
            }

            .soldier {
                width: 90px;
                height: 90px;
            }

            .arrow {
                width: 40px;
                height: 40px;
            }

            .arrow::before {
                width: 25px;
            }
        }
    </style>
</head>

        // Soldier illustrations are now images - no canvas drawing needed

        // Draw soldier illustration for modal
        function drawSoldierIllustration(canvas, action) {
            const ctx = canvas.getContext('2d');
            ctx.imageSmoothingEnabled = false;

            const colors = {
                skin: '#d4a574',
                uniform: '#6b7c3f',
                helmet: '#4a5530',
                boots: '#2d1f1a'
            };

            ctx.clearRect(0, 0, 120, 120);

            const scale = 3;
            const offsetX = 30;
            const offsetY = 10;

            // Draw based on action
            if (action === 'direction') {
                // Soldier saluting
                ctx.fillStyle = colors.helmet;
                ctx.fillRect(offsetX + 14*scale, offsetY + 8*scale, 12*scale, 8*scale);
                ctx.fillStyle = colors.skin;
                ctx.fillRect(offsetX + 14*scale, offsetY + 16*scale, 12*scale, 8*scale);
                ctx.fillStyle = colors.uniform;
                ctx.fillRect(offsetX + 12*scale, offsetY + 24*scale, 16*scale, 16*scale);
                // Saluting arm
                ctx.fillRect(offsetX + 24*scale, offsetY + 20*scale, 8*scale, 4*scale);
                ctx.fillStyle = colors.skin;
                ctx.fillRect(offsetX + 28*scale, offsetY + 16*scale, 4*scale, 4*scale);
            } else if (action === 'collection') {
                // Soldier with binoculars
                drawSoldier(canvas);
                ctx.fillStyle = '#333';
                ctx.fillRect(offsetX + 20*scale, offsetY + 16*scale, 8*scale, 4*scale);
            } else if (action === 'processing') {
                // Soldier at desk/thinking
                drawSoldier(canvas);
                ctx.fillStyle = '#666';
                ctx.fillRect(offsetX + 8*scale, offsetY + 36*scale, 24*scale, 4*scale);
            } else {
                // Soldier communicating
                drawSoldier(canvas);
                ctx.fillStyle = '#444';
                ctx.fillRect(offsetX + 26*scale, offsetY + 18*scale, 6*scale, 8*scale);
            }
        }

                <div class="arabic-title">${details.arabic}</div>
                <div class="stage-description">
                    <strong>Overview:</strong> ${details.description}
                    <br><br>
                    <strong>نظرة عامة:</strong> ${details.descriptionArabic}
                </div>
                <div class="soldier-animation">
                    <img src="${soldierImages[stage]}" alt="${details.title}" style="width: 100%; height: 100%; object-fit: contain;">
                </div>
                <div class="key-points">
                    <h3>Key Terms & Concepts</h3>
                    <ul>${pointsHTML}</ul>
                </div>
            `;

            modal.classList.add('show');
        }

        // Close modal
        function closeModal() {
            document.getElementById('modal').classList.remove('show');
        }

        // Close modal on outside click
        document.getElementById('modal').addEventListener('click', function(e) {
            if (e.target === this) {
                closeModal();
            }
        });

        // Keyboard navigation
        document.addEventListener('keydown', function(e) {
            if (e.key === 'Escape') {
                closeModal();
            }
        });
    </script>
</body>
</html>
